      </header>
      <div className="container">
        <Pomodoro isTimerRunning={isTimerRunning} focusTime={focusTime} setFocusTime={setFocusTime} setBreakTime={setBreakTime} breakTime={breakTime} sessionType={sessionType} sessionTime={sessionTime} playPause={playPause} stopTimer={stopTimer}/>
        <Active isTimerRunning={isTimerRunning} focusTime={focusTime} setFocusTime={setFocusTime} setBreakTime={setBreakTime} breakTime={breakTime} sessionType={sessionType} sessionTime={sessionTime} playPause={playPause} stopTimer={stopTimer}/>
      </div>
